PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE CLINIQUE (
    numV INT,
    nomV TEXT,
    prenomV TEXT,
    adresseV TEXT,
    telephoneV TEXT,
    specialiteV TEXT,
    numC INT,
    nomC TEXT,
    prenomC TEXT,
    adresseC TEXT,
    telephoneC TEXT,
    numA INT,
    nomA TEXT,
    dateNaissanceA DATE,
    especeA TEXT,
    numS INT,
    dateS DATE,
    diagnosticS TEXT,
    traitementS TEXT,
    PRIMARY KEY (numV, numC, numA, numS)
);
CREATE TABLE VETERINAIRES (
    numV INTEGER PRIMARY KEY AUTOINCREMENT,
    nomV TEXT,
    prenomV TEXT,
    adresseV TEXT,
    telephoneV TEXT,
    specialiteV TEXT
    );
CREATE TABLE CLIENTS (
    numC INTEGER PRIMARY KEY AUTOINCREMENT,
    nomC TEXT,
    prenomC TEXT,
    adresseC TEXT,
    telephoneC TEXT
    );
CREATE TABLE ANIMAUX (
    numA INTEGER PRIMARY KEY AUTOINCREMENT,
    nomA TEXT,
    dateNaissanceA DATE,
    especeA TEXT,
    proprietaire INTEGER NOT NULL,
    FOREIGN KEY (proprietaire) REFERENCES CLIENTS(numC) ON DELETE CASCADE
    );
CREATE TABLE SOINS (
    numS INTEGER PRIMARY KEY AUTOINCREMENT,
    dateS DATE, 
    veterinaireS INTEGER,
    animalS INTEGER NOT NULL,
    diagnosticS TEXT,
    traitementS TEXT,
    FOREIGN KEY (veterinaireS) REFERENCES VETERINAIRES(numV) ON DELETE SET NULL,
    FOREIGN KEY (animalS) REFERENCES ANIMAUX(numA) ON DELETE CASCADE
    );
CREATE TABLE FACTURES(
    numF INTEGER PRIMARY KEY AUTOINCREMENT,
    numS INTEGER NOT NULL,
    dateF DATE,
    montantF INTEGER,
    payeeF BOOLEAN NOT NULL,
    
    FOREIGN KEY (numS) REFERENCES SOINS(numS) ON DELETE CASCADE
);
DELETE FROM sqlite_sequence;
CREATE VIEW animaux_veto1 AS
SELECT A.*
FROM ANIMAUX A, SOINS S, VETERINAIRES V
WHERE
S.animalS = A.numA AND S.veterinaireS = V.numV AND V.numV = 1;
CREATE TRIGGER chirurgie AFTER INSERT ON FACTURES FOR EACH ROW BEGIN UPDATE FACTURES
SET montantF = 1000
WHERE numS IN (SELECT numS FROM SOINS WHERE traitementS LIKE "%chirurgie%")
; END;
COMMIT;
